import React, {useState, useEffect} from 'react'

const TopBar = () => {
  const [weather, setWeather] = useState({});

  useEffect(() => {
    fetch(
      `https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/Allentown%2C%20PA?unitGroup=us&key=9STJKDTHMUJ8FT23YSZHW5D7K&contentType=json`
    )
      .then((res) => res.json())
      .then((data) => {
        setWeather(data);
      });
  }, []);

  return (
    <div>{weather.address}</div>
  )
}

export default TopBar;
